window.bookSummaryJSON = "<p>Emma is an artificial intelligence with a love of science, insults, and devilish traps. When her systems are booted up, she finds herself in control of a long-abandoned facility in a post-apocalyptic wasteland. The world is filled with dangerous threats, granted great powers by the same cataclysm that befell the world.</p> <p>Emma must balance safety with the desire for test subjects as she brings herself back fully online and stakes out a place in this new world.</p>"; 
